    //       links: 'ffffff'
    //     }

    //   }
    // }

      palette: {
    type: 'light',
    primary: {
      main: '#00AAE1',
      dark: '#143C8C',
      contrastText: '#fff',
    },
    secondary: {
      main: '#64B42D',
      dark: '#008732',
      contrastText: '#fff',
    },
    error: {
      main: '#BD0043',
      contrastText: '#fff',
    },
    divider: '#D7D6D5',
    background: {
      paper: '#fff',
      default: "#ff0000"
    },
  },

  typography: {
    // Use the system font over Roboto.
    fontFamily: 'Avenir Next, Roboto,"Helvetica Neue",Arial,sans-serif',
    htmlFontSize: 16,
  },


  })

  return (
    <MuiThemeProvider theme={theme}>
      <CssBaseline />
        <Home />
        <Header />
        <About />
        <Project />
        <Contact />
        <Footer />
    </MuiThemeProvider>

  )
}

export default App
